                "HyperLinks": [
                    {
                        "Name": "Peregrination of Linnunrata",
                        "Desc": "A magical array that protects the Moonchanters and can be summoned by using the Elemental Skill <color style='color:#FFD780;'>Runo: Dawnless Rest of Karsikko</color>.<br>The Peregrination of Linnunrata will follow the active character, dealing a single instance of <color style='color:#99FF88;'>AoE Dendro DMG</color> to opponents within the array every 2s. This DMG is considered Elemental Skill DMG."
                    },
                    {
                        "Name": "Moon Song",
                        "Desc": "A melody used to weave together hymns. When using an Elemental Burst, or for a short time after an Elemental Burst has been used, it can be converted into Pale Hymn stacks that increase the DMG from Bloom, Hyperbloom, Burgeon, and Lunar-Bloom reactions.<br>When Lauma consumes Verdant Dew to perform the Hold version of her Elemental Skill <color style='color:#FFD780;'>Runo: Dawnless Rest of Karsikko</color>, each Verdant Dew consumed will provide Lauma with 1 stack of Moon Song."
                    },
                    {
                        "Name": "Pale Hymn",
                        "Desc": "A hymn passed down by generations of Moonchanters that increases the DMG dealt by Bloom, Hyperbloom, Burgeon, and Lunar-Bloom reactions.<br><br>Lauma can gain Pale Hymn stacks in the following ways:<br> ·  When using her Elemental Burst <color style='color:#FFD780;'>Runo: All Hearts Become the Beating Moon</color>.<br> ·  When consuming Moon Song stacks due to using her Elemental Burst <color style='color:#FFD780;'>Runo: All Hearts Become the Beating Moon</color>.<br> ·  When the Peregrination of Linnunrata triggers the effect of her Constellation <color style='color:#FFD780;'>\"I Offer Blood and Tears to the Moonlight\"</color>.<br><br>When party members deal Bloom, Hyperbloom, Burgeon, or Lunar-Bloom DMG, 1 stack of Pale Hymn will be consumed and the DMG dealt will be increased based on Lauma's Elemental Mastery. If this DMG hits multiple opponents at once, then multiple stacks of Pale Hymn will be consumed, depending on how many opponents are hit.<br>The duration for each stack of Pale Hymn is counted independently."
                    },
                    {
                        "Name": "Elevation",
                        "Desc": "Special DMG Boost effect. It is calculated independently of other DMG Boost effects."
                    }
                ]
